string = ""

def get_min_skew(string)

	skew = 0

	min_val = 0
	positions = []

	string.split("").each_with_index do |letter, index|
		skew -= 1 if letter == "C"
		skew += 1 if letter == "G"
		
		if skew < min_val
			positions = [index+1]
			min_val = skew
		end

		if skew == min_val
			positions << index+1
		end
	end

	return positions.uniq.join(" ")
end


puts get_min_skew(string)